import React, { Component } from 'react';

class GetWeather extends Component {
	constructor() {
		super();
		this.state = {
			city: 'Boston',
			icon: 'wi wi-day-sunny display-4',
			description: 'sunny',
			temp: 20,
			minTemp: 15,
			maxTemp: 25,
		};
	}
	render() {
		return (
			<div>
				<h3>{this.state.city}</h3>
				<i className={this.state.icon}></i>
			</div>
		);
	}
}

export default GetWeather;
